[Form]
public class ConsignmentVendorPortalOnhand extends FormRun implements InventDimICtrl_Frm
{
    private InventDimCtrl_Frm_VendorOwnedOnHand inventDimFormSetup;
    private InventAvailabilityFormCache         inventAvailabilityFormCache;

}

public void init()
{
    VendVendorPortalUserRequestManager::validateVendorPortalUserAccessToAtLeastOneVendor(this);

    super();

    inventAvailabilityFormCache = InventAvailabilityFormCache::construct();
    this.updateDesign(InventDimFormDesignUpdate::Init);
}

public InventDimCtrl_Frm inventDimSetupObject()
{
    if (!inventDimFormSetup)
    {
        inventDimFormSetup = InventDimCtrl_Frm_VendorOwnedOnHand::newFromForm(element);
        inventDimFormSetup.parmLargeRightClickForm(NoYes::Yes);
        inventDimFormSetup.parmGroupByNameAlias(NoYes::Yes);
    }
    return inventDimFormSetup;
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
        case InventDimFormDesignUpdate::LinkActive:
            this.inventDimSetupObjectOnHand().parmCtrlItemId(inventSum_ItemId);
            this.inventDimSetupObject().parmDimParmVisible(this.inventDimSetupObject().parmDimParmVisibleGrid());
        // No break
        case InventDimFormDesignUpdate::Active:
            this.inventDimSetupObject().formActiveSetup();
            this.inventDimSetupObject().formSetControls(true, true);
            break;

        default : throw error(strFmt("@SYS54195", funcName()));
    }
}

public void rightClickModifyQuery()
{
    this.inventDimSetupObject().parmDimParmVisible(this.inventDimSetupObject().parmDimParmVisibleGrid());
    this.inventDimSetupObject().rightClickModifyQueryGroupBy(inventSum_DS);  // Preserve ranges

    inventSum_DS.executeQuery();
}

display public InventQtyAvailPhysical availPhysical(InventSum _inventSum)
{
    InventQty qtyInvent = inventAvailabilityFormCache.availabilityFromSumJoinedWithDim(_inventSum, inventDim_ds).availPhysical();

    return TradeQuantityUnitOfMeasureConverter::convertReleasedProductInventoryToPurchaseQuantity(_inventSum.ItemId, _inventSum.InventDimId, qtyInvent);
}

display public ExternalItemId externalItemId(InventSum _inventSum)
{
    VendTable vendTableJoined = formJoinedRecord(_inventSum, VendTable_DS);
    return _inventSum.inventTable().externalItemId(ModuleInventCustVend::Vend, vendTableJoined.AccountNum);
}

public void executeQuery()
{
    element.inventDimSetupObjectOnHand().modifyQuery(inventSum_DS, inventDim_DS);
    inventAvailabilityFormCache.refreshCache();

    // We need vendor account to find external Item Id. Group by it to get the values.
    inventSum_DS.query().dataSourceTable(tableNum(VendTable)).addGroupByField(fieldNum(VendTable, AccountNum));

    super();
}

public int active()
{
    int ret = super();
    inventDim_ds.active();

    return ret;
}
